import React, { useState, useEffect, useRef } from 'react';
import Post from '../../components/Post/Post';
import './Home.css';

const Home = () => {
  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [loadingMore, setLoadingMore] = useState(false);
  const [hasMore, setHasMore] = useState(true);
  const loadCountRef = useRef(0);
  const loaderRef = useRef(null);

  // Mock data for demonstration
  useEffect(() => {
    const mockPosts = [
      {
        id: 1,
        title: "Beautiful Mountain Landscape",
        description: "Stunning view of snow-capped mountains at sunset",
        imageUrl: "https://images.unsplash.com/photo-1506905925346-21bda4d32df4?w=400&h=400&fit=crop",
        author: {
          name: "Nature Lover",
          avatar: "https://images.unsplash.com/photo-1472099645785-5658abf4ff4e?w=50&h=50&fit=crop&crop=face"
        },
        likes: 124,
        comments: 8,
        isLiked: false,
        isSaved: false
      },
      {
        id: 2,
        title: "Delicious Food Photography",
        description: "Homemade pasta with fresh herbs and parmesan",
        imageUrl: "https://images.unsplash.com/photo-1563379926898-05f4575a45d8?w=400&h=600&fit=crop",
        author: {
          name: "Foodie Chef",
          avatar: "https://images.unsplash.com/photo-1494790108755-2616b612b786?w=50&h=50&fit=crop&crop=face"
        },
        likes: 89,
        comments: 12,
        isLiked: true,
        isSaved: false
      },
      {
        id: 3,
        title: "Modern Interior Design",
        description: "Minimalist living room with natural light",
        imageUrl: "https://images.unsplash.com/photo-1586023492125-27b2c045efd7?w=400&h=500&fit=crop",
        author: {
          name: "Design Studio",
          avatar: "https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?w=50&h=50&fit=crop&crop=face"
        },
        likes: 256,
        comments: 23,
        isLiked: false,
        isSaved: true
      },
      {
        id: 4,
        title: "Travel Photography",
        description: "Ancient temple in Southeast Asia",
        imageUrl: "https://images.unsplash.com/photo-1548013146-79ded13c9d56?w=400&h=700&fit=crop",
        author: {
          name: "Wanderlust",
          avatar: "https://images.unsplash.com/photo-1500648767791-00dcc994a43e?w=50&h=50&fit=crop&crop=face"
        },
        likes: 167,
        comments: 15,
        isLiked: false,
        isSaved: false
      },
      {
        id: 5,
        title: "Artistic Photography",
        description: "Abstract patterns in urban architecture",
        imageUrl: "https://images.unsplash.com/photo-1449824913935-59a10b8d2000?w=400&h=400&fit=crop",
        author: {
          name: "Art Vision",
          avatar: "https://images.unsplash.com/photo-1438761681033-6461ffad8d80?w=50&h=50&fit=crop&crop=face"
        },
        likes: 98,
        comments: 7,
        isLiked: true,
        isSaved: false
      },
      {
        id: 6,
        title: "Fashion Inspiration",
        description: "Street style fashion in the city",
        imageUrl: "https://images.unsplash.com/photo-1445205170230-053b83016050?w=400&h=600&fit=crop",
        author: {
          name: "Style Guide",
          avatar: "https://images.unsplash.com/photo-1506794778202-cad84cf45f1d?w=50&h=50&fit=crop&crop=face"
        },
        likes: 203,
        comments: 18,
        isLiked: false,
        isSaved: true
      }
    ];

    // Simulate loading
    setTimeout(() => {
      setPosts(mockPosts);
      setLoading(false);
    }, 1000);
  }, []);

  // Infinite scroll observer (structure only; does not append posts yet)
  useEffect(() => {
    if (!hasMore) return;
    const sentinel = loaderRef.current;
    if (!sentinel) return;

    const observer = new IntersectionObserver((entries) => {
      const first = entries[0];
      if (first.isIntersecting && !loadingMore) {
        setLoadingMore(true);
        setTimeout(() => {
          // Dynamically append a recycled batch to demonstrate masonry fill (no static additions)
          loadCountRef.current += 1;
          const batchIndex = loadCountRef.current;
          const recycled = posts.map((p, idx) => ({
            ...p,
            id: `${p.id}-b${batchIndex}-${idx}`
          }));
          setPosts(prev => [...prev, ...recycled]);
          if (batchIndex >= 3) {
            setHasMore(false);
          }
          setLoadingMore(false);
        }, 600);
      }
    }, { root: null, rootMargin: '200px', threshold: 0.01 });

    observer.observe(sentinel);
    return () => observer.disconnect();
  }, [loadingMore, hasMore]);

  if (loading) {
    return (
      <div className="loading">
        <div className="loading-spinner"></div>
      </div>
    );
  }

  return (
    <div className="home">
      <div className="container">
        <div className="home-header">
          <h1>Welcome to Clipnest</h1>
          <p>Discover and share amazing posts with the world</p>
        </div>
        
        <div className="posts-grid">
          {posts.map(post => (
            <div key={post.id} className="post-wrapper">
              <Post post={post} />
            </div>
          ))}
          <div ref={loaderRef} />
        </div>
        {loadingMore && (
          <div className="loading" aria-live="polite" aria-busy="true">
            <div className="loading-spinner"></div>
          </div>
        )}
      </div>
    </div>
  );
};

export default Home;
